import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';


import Navbar from './Components/Navbar';
import Jumbotron from './Components/Jumbotron'
import Recent from './Components/Recent'



function MainMenu(){
    return (
        <div>
            {Navbar()}
            {Jumbotron()}
            {Recent()}
        </div>
    )
  }

export default MainMenu;
